import React from 'react';

// ...existing code...

type Expense = {
    id: string;
    title: string;
    description: string;
    amount: number;
    date: string;
};

type ExpenseListProps = {
    expenses: Expense[];
    onDelete: (id: string) => void;
};

const ExpenseList = ({ expenses, onDelete }: ExpenseListProps) => {
    return (
        <div className="mt-4">
            <h2 className="mb-3">Expenses</h2>
            <ul className="list-group">
                {expenses.map((expense: Expense) => (
                    <li key={expense.id} className="list-group-item d-flex justify-content-between align-items-center mb-2">
                        <div>
                            <strong>{expense.title}</strong> <span className="text-muted">(${expense.amount})</span>
                            <br />
                            <small className="text-secondary">{expense.date}</small>
                        </div>
                        <button
                            className="btn btn-danger btn-sm d-flex align-items-center"
                            onClick={() => onDelete(expense.id)}
                            title="Delete"
                        >
                            <span className="material-icons">delete</span>
                        </button>
                    </li>
                ))}
            </ul>
        </div>
    );
};

export default ExpenseList;
